        console.log(text)
    }
    const d = (a,b)=>{ 
        var r =  a+b;
        console.log(r)
       
    }
    useEffect(()=>{
        d(1,text)
    },[text])

    return(
        <div>
            <br></br>
           
                <input id="rt" type="text"></input>
                <button onClick={onch}>ok</button>
           

            <ul>
                <li>{text}</li>
            </ul>
        </div>
   
    )

}


export default Input;




